import React, { Component } from 'react';
import Listings from '../components/listings';

class FeaturedListings extends Component {
  render() {
    const data = ['listing1', 'listing2', 'listing3', 'listing4'];
    return (
      <div>
        <div className='row'>
          <Listings data={data} />
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
        </div>
        <div className='row'>
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
          <div className='col-1-of-3'>
            <p>Listing 1</p>
          </div>
        </div>
      </div>
    );
  }
}

export default FeaturedListings;
